import "./card.scss";

const Card = ({ album }) => {
  return (
    <div className="card">
      <div className="img-ctn">
        {album?.covert?.sources?.map((source, index) => (
          <img key={index} src={source[0].url} />
        ))}
      </div>
      <div className="txt-ctn">
        <h5 className="title">{album?.data?.name}</h5>
        <p className="desc">Lorem ipsum dolor sit amet.</p>
      </div>
    </div>
  );
};

export default Card;
